import { useState, useEffect } from 'react';

function Time() {
  const [count, setCount] = useState(0);


  useEffect(() => {
setTimeout(() => {
      setCount((prev) => prev + 1);
    }, 1000);
    return () => clearTimeout();
  });

  return (
    <>
      <h4> You have used {count} seconds on this website</h4>
    </>
  );
}

export default Time;
